import React from 'react';

import { DataGrid } from '@material-ui/data-grid';

function BasicTable(props) {
    const { columns, rows } = props;
    return (
        <React.Fragment>
            <DataGrid columns={columns} rows={rows} />
        </React.Fragment>
    )
}

export default BasicTable;
